	function initEvent() {
		axios.post( '/ajax/busevent' )
		.then( function (response) {
			if ( response.data != null ) {
				busEvent(response.data);
			}
		})
	    .catch( function (error) {
	    	 Log.d('poi_info() -> error=', error);
	    });
	}
	
	function busEvent(data) {
		setDate();
		for(var i =0; i<getID('eventBody').childNodes.length; i++) {
			var li = getID('eventBody').childNodes[i];
			if(li.nodeName.toLowerCase() === 'li'){
	            li.style.display ='none';
	        }
		}
		if(data['rtcm'] !=null) {
			
			getID('rtcm').innerText = data['rtcm'];
			getID('rtcm').setAttribute('title', data['rtcm']);
			getID('rtcm').style.display ='block';
		}
		
		var noticesCnt = (data['notices'] !=null)?data['notices'].length:0;
		var brokensCnt = (data['brokens'] !=null)?data['brokens'].length:0;
		var maxCnt = 5;
		if(noticesCnt+brokensCnt > maxCnt) {
			noticesCnt = 3;
			brokensCnt = 2;
		} 
		if(data['notices'] !=null) {
			for(var i=0; i<noticesCnt; i++) {
				if(i > 1) break;
				if(getID('notices'+i) == null)return;
				getID('notices'+i).innerText = data['notices'][i];
				getID('notices'+i).setAttribute('title', data['notices'][i]);
				getID('notices'+i).style.display ='block';
			}
		}
		if(data['brokens'] !=null) {
			for(var i=0; i<brokensCnt; i++) {
				if(i > 1) break;
				getID('brokens'+i).innerText = data['brokens'][i];
				getID('brokens'+i).setAttribute('title', data['brokens'][i]);
				getID('brokens'+i).style.display ='block';
			}
		}
		if(data['weather'] != null) {
			getID('weatherTemp').innerText = data['weather']['temperature'];
			getID('weatherTxt').innerText = data['weather']['weathertext'];
			getID('weatherIcon').style.backgroundRepeat = "no-repeat";
		    getID('weatherIcon').style.backgroundImage = "url('/fcev/images/weather/"+data['weather']['weathericon']+".png')";
		    getID('weatherIcon').style.backgroundSize = "100px";
		    getID('weatherIcon').style.backgroundPosition  = "50% 50%";
		}
		
	}
