	function busData(json) {
//		if(json.lat == null || json.lng == null) return;
//		if(json.lat.isNan() || json.lng.isNan()) return;
		var lng = (json.lng / 1000000); // 경도
	    var lat = (json.lat / 1000000);  // 위도
	    var speed = parseInt(json.speed *0.02* _SPEED,10); // 속
	    var averageSpeed = json['averageSpeed'];
	    var idx = json.name;
	    var state = dMap.getVerify(idx);
	    var mode = (json.drivingMode == 1) ? '자율주행' : '수동주행';
	    getID('mode_'+idx).innerText = mode;
	    if(typeof(json['state']) != "undefined") {
	    	 dMap.setVerify(idx, json['state']);
	    }
	    
	    if(dMap.getMarker(idx).getMap() == null) {
	    	startEvent(json);
	    }
	    
	    if(state != null){
	    	dMap.setVerify(idx, null);
	    }
	    	
		obChart.update(dashChart[idx], speed,averageSpeed);
		if(typeof(dMap.getMarker(idx)) == 'undefined') return;
		var miter = getDistanceFromLatLonInKm(dMap.getMarker(idx).getPosition(), new kakao.maps.LatLng(lat, lng))
		if(miter < _MITERUNIT  || ( speed <= 0) || busPostion[idx].length == 0 ) {
			busPostion[idx][0] = dMap.getMarker(idx).getPosition();
			busPostion[idx][1] = new kakao.maps.LatLng(lat, lng);
			_STEP = 20;
			dMap.getMarker(idx).setPosition(new kakao.maps.LatLng(lat, lng))
			return; 
		}
		
		if(miter < 60) {
			_STEP = 20;
		}
		else {
			_STEP = 60;
		}
		
		if(event != 999&& idx == event){
			map.panTo(new kakao.maps.LatLng(lat, lng),32);
		}
		
	    if(busPostion[idx].length > 0) {
	    	
    		busPostion[idx][0] =  dMap.getMarker(idx).getPosition();		
	    	idxTimerStep[idx] = 0;
	    	busPostion[idx][1] = new kakao.maps.LatLng(lat, lng);
	    	headingSet(idx);
	    }
	    
	    else {
	    	dMap.getMarker(idx).setPosition(new kakao.maps.LatLng(lat, lng))
	    	busPostion[idx][0] = new kakao.maps.LatLng(lat, lng);
	    }
	    
	}
	
