	function movingBus(idx, numSteps) {
		
		if(typeof(idxTimerStep[idx]) == "undefined") return; 
		if(busPostion[idx].length > 1) {
			idxTimerStep[idx]+=1;
			if (idxTimerStep[idx] > numSteps) {
				idxTimerStep[idx] = 0;
				busPostion[idx][0] = dMap.getMarker(idx).getPosition();	
			}
			else {
				movingBusEvent(idxTimerStep[idx],numSteps,idx);
			}
			window.clearTimeout(idxTimer[idx]);
			
		}
	}
	
	
