	function movingBusEvent(step,numSteps,idx) {
		var departure = busPostion[idx][0];
		var arrival = busPostion[idx][1];
		var coordsDeparture = new google.maps.LatLng(departure.getLat(), departure.getLng());
		var coordsArrival = new google.maps.LatLng(arrival.getLat(), arrival.getLng());
		var are_we_there_yet = google.maps.geometry.spherical.interpolate(coordsDeparture, coordsArrival, step / numSteps);
		dMap.getMarker(idx).setPosition(new kakao.maps.LatLng(are_we_there_yet.lat(), are_we_there_yet.lng()))
		
	}
	
	
	function headingSet(idx) {
		
		var departure = dMap.getMarker(idx).getPosition();	
		var arrival = busPostion[idx][1];
		var coordsDeparture = new google.maps.LatLng(departure.getLat(), departure.getLng());
		var coordsArrival = new google.maps.LatLng(arrival.getLat(), arrival.getLng());
		var heading = parseInt(google.maps.geometry.spherical.computeHeading(coordsDeparture, coordsArrival),10);
		if(typeof(headingData[idx]) == "undefined" || headingData[idx] != heading) {
			headingData[idx] = heading;
			$('img[src="/fcev/images/car/car.png#_'+idx+'"]').css({
			    'transform': 'rotate('+heading+'deg)'
			});
		}
	}
	
		
