	function sendMsg() {
		
		var pvdName = getID('vehicleSelect').options[getID('vehicleSelect').selectedIndex].value;
		var msgContents = getID('qcContents').value;
		
		if(msgContents =='') return;
		var params = new URLSearchParams();
		params.append( 'pvdName', pvdName);
		params.append( 'msgContents', msgContents);
		
		axios.post( '/ajax/senMsg', params)
		.then( function (response) {
			var data = response.data;
			if(data.result == 'failed') {
				alert(data.desc);
				return;
			}
			getID('qcContents').value ='';
			
			
		})
	    .catch( function (error) {
	    	 Log.d('selectReplaySeq() -> error=', error);
	    });
	}
	
	
	function init() {
		
		axios.post( '/popup/vehicleDash',)
		.then( function (response) {
			var data = response.data;
			if(data.result == 'fail') {
				alert(data.desc);
				return;
			}
			
			if(typeof(data['busEvent']) != 'undefined') {
				busEvent(data['busEvent']);
			}
			initCar(data['vehicleList'], data['verifyActiveCnt']);
			initPoi(data['poiList']);
			if(typeof(data['notifyJson']) != 'undefined') {
				busApiInfo(data['notifyJson']['busList']);
			}
			startingPvd(data['startCarMap']);
			
			if(typeof(data['connectedMap']) != 'undefined') {
				for(key in data['connectedMap']) {
					var connectedData = {};
					if(data['connectedMap'][key] == true) {
						connectedData['name'] = key;
						connectedData['code'] = 'gray';
						connection(connectedData)
					}
				}
			}
		})
	    .catch( function (error) {
	    	 Log.d('selectReplaySeq() -> error=', error);
	    });
		
		
		initMap();
		initLine('naviLine');

		//상단 노트 초기설정 
		AccumulateDistanceStaut();
		
//			obProgress.update("car_1",70);

		//날자정보 초기설정
		setDate();
	}
	
